(window.webpackJsonp=window.webpackJsonp||[]).push([[905],{1260:function(n,h,t){"use strict";t.r(h);var g=t(44),i=Object(g.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-1788-mot-cau-trach-đi-【-canh-4-】"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1788-mot-cau-trach-đi-【-canh-4-】"}},[n._v("#")]),n._v(" Chương 1788: Một câu trách đi 【 Canh [4] 】")]),n._v(" "),t("hr"),n._v(" "),t("p",[n._v("Chương 1788: Một câu trách đi "),t("br"),t("br"),n._v("Những người khác tất cả đều run lẩy bẩy, từng cái trên mặt hối hận sắc."),t("br"),t("br"),n._v("Một mực nghe nói, Địa quật khắp nơi bảo vật, chỉ cần đi vào, vận khí không quá nát, đều có thể kiếm lời lớn, đạt được đầy đủ tài nguyên tu luyện, làm sao cũng không nghĩ đến, mới đi đến không đủ nửa canh giờ, liền gặp lợi hại như vậy đàn sói, liền trong bọn họ mạnh nhất Ngô sư, đều một chiêu tan tác."),t("br"),t("br"),n._v("Hắn cũng không là đối thủ, nhóm người mình nên làm gì?"),t("br"),t("br"),n._v("“Đồng loạt ra tay, nếu không, thật sự phải chết ở chỗ này...”"),t("br"),t("br"),n._v("Một vị lão giả hàm răng cắn chặt, lấy ra một cây trường mâu, chân khí tràn vào, mũi thương lực lượng phun ra nuốt vào, tựa như trường xà."),t("br"),t("br"),n._v("Tu vi của hắn chỉ là Thánh vực tứ trọng Nguyên Thần cảnh sơ kỳ, lại có thể thi triển ra vũ khí khí mang, đổi lại bình thường, nhất định có thể đổi lấy reo hò, để cho người ta kinh thán không thôi, mà bây giờ, tại đàn sói trong mắt, hài đồng đồng dạng buồn cười."),t("br"),t("br"),n._v("Phần phật!"),t("br"),t("br"),n._v("Một đầu Phong Diệp lang động, không cần Lang Vương ra tay, bình thường sói xám, hàm răng nhẹ nhàng khẽ cắn, liền đem mâu mang nuốt mất, đồng thời móng vuốt vung một cái, máu tươi phun mạnh, vị lão giả này ngực liền xuất hiện một lỗ hổng khổng lồ."),t("br"),t("br"),n._v("“La công...”"),t("br"),t("br"),n._v("Gặp hắn bị thương, bên cạnh hắn một vị trung niên kìm nén không được, ra ngoài vũ khí cũng vọt tới, những người khác cũng rõ ràng sống còn, không dám thất lễ, tất cả đều đồng loạt xông lên, từng cái thi triển ra tuyệt chiêu mạnh nhất."),t("br"),t("br"),n._v("Thình thịch thình thịch bành!"),t("br"),t("br"),n._v("Phá bao tải thanh âm vang lên, xông tới đám người, lấy tốc độ nhanh hơn bay ngược mà ra, từng cái rơi trên mặt đất, mặt mũi tro bụi, khóe miệng tràn ra máu tươi."),t("br"),t("br"),n._v("Thực lực chênh lệch quá lớn, lại đối Huyết Nguyệt bao phủ xuống hoàn cảnh chưa quen thuộc, mới bắt đầu, cũng đã kết thúc."),t("br"),t("br"),n._v("Nhìn thấy bản thân dẫn dắt người, không chịu được như thế một đòn, Ngô Khoáng lộ ra tuyệt vọng."),t("br"),t("br"),n._v("Sớm biết, chỉ có một người đến đây, chí ít mục tiêu nhỏ một ít, cũng có thể tùy cơ ứng biến, trực tiếp rời đi."),t("br"),t("br"),n._v("Hiện tại tốt, chỉ sợ đều muốn vẫn lạc ở đây, lại không khả năng đào tẩu."),t("br"),t("br"),n._v("Đang nghĩ ngợi, những này đàn sói nên làm gì đối phó bản thân, con mắt thoáng nhìn phía dưới, ngay sau đó nhìn thấy trước đó không nguyện ý mang hai người, vẫn như cũ ngồi tại nguyên chỗ, cũng chưa hề đụng tới."),t("br"),t("br"),n._v("Hình như cũng không phát hiện đàn sói tới đồng dạng."),t("br"),t("br"),n._v("“Bọn họ...”"),t("br"),t("br"),n._v("Vừa định nổi giận, ngay sau đó than thở một tiếng: “Quên đi, loại thực lực này, xông lại cũng vô dụng...”"),t("br"),t("br"),n._v("Một cái ốm yếu, một cái liền Thánh vực khả năng đều không có đạt tới... Hắn vị này thất tinh đỉnh phong danh sư, đều chống lại không ngừng Phong Diệp lang quần, coi như bọn họ động thủ, thì có ích lợi gì?"),t("br"),t("br"),n._v("“Nhân loại danh sư, trong cơ thể lực lượng tinh thuần, ăn đại bổ, cái này để lại cho ta, cái khác các ngươi xử lý...”"),t("br"),t("br"),n._v("Thấy mọi người đã không còn sức phản kháng, Lang Vương hừ lạnh, cất bước hướng trước mắt Ngô Khoáng đi tới."),t("br"),t("br"),n._v("Bất luận đối với Dị Linh tộc hay là trong đó sinh hoạt Thánh thú, danh sư trong cơ thể tinh thuần chân khí, đều là đại bổ."),t("br"),t("br"),n._v("“Không nghĩ tới ta Ngô Khoáng, vậy mà chết ở chỗ này...”"),t("br"),t("br"),n._v("Gặp Lang Vương càng đi càng gần, biết tai kiếp khó thoát, Ngô Khoáng ánh mắt lộ ra một tia bi ai."),t("br"),t("br"),n._v("Còn tưởng rằng đi vào Địa quật, dựa vào thất tinh đỉnh phong danh sư thân phận, có thể nhiều đất dụng võ, nằm mộng cũng nghĩ không ra, còn chưa kịp ra tay, cũng đã triệt để kết thúc."),t("br"),t("br"),n._v("Thầm nghĩ lấy, trong cơ thể lần nữa tuôn ra một cỗ lực lượng, muốn cùng trước mắt Lang Vương đồng quy vu tận, đột nhiên mặt một hồi lay động, một cái trầm muộn thanh âm từ dưới đất phát ra, không biết từ đâu vang lên, chấn nhiếp mỗi người linh hồn."),t("br"),t("br"),n._v("“Cút!”"),t("br"),t("br"),n._v("Ầm ầm!"),t("br"),t("br"),n._v("Thanh âm mang theo âm lãnh, dường như gió lốc bao phủ, Phong Diệp lang vương cùng cái khác nhiều lang, đồng thời cho rằng lông tơ nổ lên, kìm lòng không được lui về sau mấy chục bước, thân thể to lớn không ngừng run rẩy, từng cái khóe miệng tràn ra máu tươi."),t("br"),t("br"),n._v("Quát khẽ một tiếng, vậy mà để bọn chúng đồng thời bị thương!"),t("br"),t("br"),n._v("Trong mắt mang theo kinh hoàng, Lang Vương vội vàng hướng bốn phía nhìn lại."),t("br"),t("br"),n._v("Huyết Nguyệt bao phủ xuống, bốn phía mênh mông, không có nửa cái bóng người, gió nhẹ thổi, trên người bay lên một hơi khí lạnh."),t("br"),t("br"),n._v("Vừa rồi cái thanh âm kia, tuy là âm u, lại cho nó một loại đâm vào linh hồn cảm giác, dường như thực có can đảm đối với những người này loại động thủ, sẽ bị trực tiếp chém giết, thần tiên khó cứu."),t("br"),t("br"),n._v("“Đi!”"),t("br"),t("br"),n._v("Biết vị cao thủ này, chẳng biết lúc nào sẽ ra tay, Lang Vương không ngừng run rẩy, cuối cùng không dám đối Ngô Khoáng đám người ra tay, đuôi kẹp lấy, xoay người bỏ chạy."),t("br"),n._v("Vài cái nhân loại danh sư mà thôi, coi như chất thịt ngon, cũng không kịp cái mạng nhỏ của mình đáng giá."),t("br"),t("br"),n._v("“Đa tạ tiền bối ân cứu mạng...”"),t("br"),t("br"),n._v("Gặp đàn sói rời đi, Ngô Khoáng cùng đám người nhìn nhau, mỗi người từ trên mặt lộ ra sống sót sau tai nạn biểu lộ, đồng loạt đứng dậy, quỳ rạp xuống đất."),t("br"),t("br"),n._v("Mặc dù không biết vị tiền bối này ở nơi nào, nhưng có thể mượn mặt đất truyền âm, hẳn là có thể nhìn thấy động tác của bọn hắn, nghe được bọn họ cảm kích."),t("br"),t("br"),n._v("Cảm kích hồi lâu, cũng không phát hiện có người xuất hiện, liền giống như vừa rồi vị tiền bối kia, căn bản không tồn tại đồng dạng."),t("br"),t("br"),n._v("“Ngô sư, làm sao bây giờ?”"),t("br"),t("br"),n._v("Gặp không có người trả lời, vừa rồi vị kia “La công”, nhìn lại."),t("br"),t("br"),n._v("“Cao nhân làm việc, không phải chúng ta có thể phỏng đoán, nếu không muốn thấy chúng ta, hay là nắm chặt rời đi đi...”"),t("br"),t("br"),n._v("Trầm tư một chút, Ngô Khoáng nói."),t("br"),t("br"),n._v("Hắn chuyên môn cảm kích, đối phương cũng không có xuất hiện, nói rõ cũng không nguyện ý lộ diện, cưỡng cầu cũng không có cái gì tác dụng."),t("br"),t("br"),n._v("“Ừm!”"),t("br"),t("br"),n._v("Có đàn sói sự tình, đám người biết nơi này nguy cơ, không dám tiếp tục chờ lâu, đồng loạt đi thẳng về phía trước."),t("br"),t("br"),n._v("Đi gần nửa canh giờ, gặp lại không nguy cơ, đồng thời thở phào nhẹ nhõm."),t("br"),t("br"),n._v("“Ta biết một chỗ có dược liệu, chúng ta nhanh lên một chút đi, đạt được liền về, nếu không, thật sự đến không một hồi!” Trầm tư một chút, Ngô sư nói."),t("br"),t("br"),n._v("Đều đã đi tới nơi này, cũng không thể bởi vì sợ hãi nguy cơ liền lùi bước."),t("br"),t("br"),n._v("Thật muốn trực tiếp rời đi, không chỉ cái gì cũng không chiếm được, cùng binh sĩ không đánh mà chạy đồng dạng, đối tâm cảnh cùng tu luyện về sau cũng sẽ có ảnh hưởng rất lớn."),t("br"),t("br"),n._v("Đám người gật gật đầu."),t("br"),t("br"),n._v("“Tại xuất phát phía trước, ta muốn nói hai câu!”"),t("br"),t("br"),n._v("Một vị trung niên đi ra."),t("br"),t("br"),n._v("Đám người đồng loạt nhìn tới."),t("br"),t("br"),n._v("“Vừa rồi nguy cơ, hai vị này không nhúc nhích, mảy may cống hiến đều không có, đi tìm dược liệu, ta đề nghị, lại không dẫn bọn hắn!”"),t("br"),t("br"),n._v("Trung niên nhân hừ lạnh, chỉ hướng Trương Huyền cùng Ngột Thần."),t("br"),t("br"),n._v("Hai người này đàn sói tới thời điểm, ngồi dưới đất giả chết, một điểm sức chiến đấu đều không có... Hiện tại muốn đi tìm dược liệu, lại còn đi theo, da mặt thật là không phải bình thường dày!"),t("br"),t("br"),n._v("“Không sai, không thể dẫn bọn hắn!”"),t("br"),t("br"),n._v("“Cái gì dùng đều không có, mang theo cũng là vướng víu!”"),t("br"),t("br"),n._v("Lại có mấy người đồng thời gật đầu."),t("br"),t("br"),n._v("Bọn họ là tới mạo hiểm, trong đội ngũ càng mạnh càng tốt, hai người kia, cái gì đều không làm được, còn muốn đi theo nhào bột mì, chẳng lẽ còn thật muốn chờ lấy đạt được dược liệu về sau, phân cho bọn họ một bộ phận?"),t("br"),t("br"),n._v("Nghe được lời của mọi người, Ngô Khoáng cau mày, nhìn về phía hai người: “Các ngươi nhưng có lại nói?”"),t("br"),t("br"),n._v("Không phải là không muốn mang, mà là hai người này vừa rồi gặp phải đàn sói lúc biểu hiện, thực sự quá kém."),t("br"),t("br"),n._v("“Ta không lời nào để nói...”"),t("br"),t("br"),n._v("Ngột Thần vừa định nói ra miệng, Trương Huyền khoát tay áo."),t("br"),t("br"),n._v("“Vậy còn không mau cút!”"),t("br"),t("br"),n._v("Vừa rồi trung niên nhân quát lạnh."),t("br"),t("br"),n._v("“Chư vị nhiều hơn bảo trọng...”"),t("br"),t("br"),n._v("Không muốn nhìn đám người ưa thích, Trương Huyền lắc đầu, ôm quyền, vừa định rời đi, liền cảm thấy trên bầu trời một cỗ cường đại khí tức bỗng nhiên áp bức mà đến, ngay sau đó trên không một đầu to lớn kền kền, chậm rãi bay thấp."),t("br"),t("br"),n._v("Người đăng: ThấtDạ"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-1799"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-1801"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=i.exports}}]);